-- ----------------------------
-- Table structure for orderdetail
-- ----------------------------
DROP TABLE IF EXISTS `orderdetail`;
CREATE TABLE `orderdetail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '子订单ID,主键，自增',
  `mainOrderId` int(11) DEFAULT NULL COMMENT '主订单ID',
  `passengerId` varchar(18) DEFAULT NULL COMMENT '乘车人证件号，如身份证号',
  `passengerName` varchar(20) DEFAULT NULL COMMENT '乘车人姓名',
  `startStation` varchar(20) DEFAULT NULL COMMENT '出发车站',
  `endStation` varchar(20) DEFAULT NULL COMMENT '目的地车站',
  `trainListId` varchar(20) DEFAULT NULL COMMENT ' 车次',
  `departureTime` varchar(10) DEFAULT NULL COMMENT '开车时间',
  `arriveTime` varchar(10) DEFAULT NULL COMMENT '到达时间',
  `departureDate` date DEFAULT NULL COMMENT '乘车日期',
  `trainType` varchar(10) DEFAULT NULL COMMENT '列车类型',
  `carriage` tinyint(4) DEFAULT NULL,
  `seatNumber` int(11) DEFAULT NULL COMMENT '车厢号座位号',
  `seatDetail` varchar(10) DEFAULT NULL COMMENT '座位具体类型，对于动车或高铁该值为A、B、C，对于硬卧该值为上、中、下，对于软卧该值为上、下，其余的均为空值。',
  `seatType` varchar(10) DEFAULT NULL COMMENT '席别',
  `price` float DEFAULT NULL COMMENT '票价',
  `ticketStatus` tinyint(4) DEFAULT NULL COMMENT '车票状态，0为正常票，1为改签票，2为已退票',
  `orderStatus` tinyint(4) DEFAULT NULL COMMENT '订单状态，0为未支付，1为已支付',
  `isStudent` tinyint(4) DEFAULT '0' COMMENT '是否学生票，1表示学生票，0表示普通票',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

