-- Records of orderdetail
-- ----------------------------

-- ----------------------------
-- Table structure for train
-- ----------------------------
DROP TABLE IF EXISTS `train`;
CREATE TABLE `train` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trainListId` varchar(20) DEFAULT NULL COMMENT '车次，对应train表里的ID',
  `type` varchar(10) DEFAULT NULL COMMENT '列车类型',
  `station` varchar(20) DEFAULT NULL COMMENT '起点站',
  `stationNumber` tinyint(4) DEFAULT NULL COMMENT '当前站点在车次里的序号,起点站为1',
  `runDay` tinyint(4) DEFAULT NULL COMMENT '运行天数，即运行第几天',
  `arriveTime` varchar(10) DEFAULT NULL COMMENT '到达时间',
  `departureTime` varchar(10) DEFAULT NULL COMMENT ' 开车时间',
  `runTime` varchar(20) DEFAULT NULL COMMENT '运行时间，即历时',
  `distance` int(11) DEFAULT NULL COMMENT '运行里程',
  `businessSeatPrice` float DEFAULT '0' COMMENT '商务座票价',
  `firstSeatPrice` float DEFAULT '0' COMMENT '一等座票价',
  `secondSeatPrice` float DEFAULT '0' COMMENT '二等座票价',
  `hardSeatPrice` float DEFAULT '0' COMMENT '硬座票价',
  `softSeatPrice` float DEFAULT '0' COMMENT '软座票价',
  `hardBerth1Price` float DEFAULT '0' COMMENT ' 硬卧上铺票价',
  `hardBerth2Price` float DEFAULT '0' COMMENT '硬卧中铺票价',
  `hardBerth3Price` float DEFAULT '0' COMMENT '硬卧下铺票价',
  `softBerth1Price` float DEFAULT '0' COMMENT '软卧上铺票价',
  `softBerth2Price` float DEFAULT '0' COMMENT '软卧下铺票价',
  `noSeatPrice` float DEFAULT '0' COMMENT '无座票价',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6734 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of train
-- ----------------------------

-- ----------------------------
-- Table structure for trainlist
-- ----------------------------
DROP TABLE IF EXISTS `trainlist`;
CREATE TABLE `trainlist` (
  `id` varchar(20) NOT NULL COMMENT '车次,对应train表里面的TrainListID',
  `type` varchar(10) DEFAULT NULL COMMENT '列车类型',
  `startStation` varchar(20) DEFAULT NULL COMMENT '起点站',
  `endStation` varchar(20) DEFAULT NULL COMMENT '终点站',
  `runTime` varchar(20) DEFAULT NULL COMMENT '运行时间,即历时',
  `distance` int(11) DEFAULT NULL COMMENT '运行里程',
  `businessSeat` int(11) DEFAULT NULL COMMENT '商务座席位数',
  `firstSeat` int(11) DEFAULT NULL COMMENT '一等座席位数',
  `secondSeat` int(11) DEFAULT NULL COMMENT '二等座席位数',
  `hardSeat` int(11) DEFAULT NULL COMMENT ' 硬座席位数',
  `softSeat` int(11) DEFAULT NULL COMMENT '软座席位数',
  `hardBerth` int(11) DEFAULT NULL COMMENT '硬卧席位数，因硬卧上铺、中铺和下铺的席位数相同，因此这里只用一个字段表示。若值为100,则表示上铺、中铺和下铺的席位数均为100.',
  `softBerth` int(11) DEFAULT NULL COMMENT '软卧席位数，因软卧上铺和下铺的席位数相同，因此这里只用一个字段表示。若值为20,则表示上铺和下铺的席位数均为20.',
  `noSeat` int(11) DEFAULT NULL COMMENT '无座席位数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

