  `softSeatCapacity` int(11) DEFAULT NULL COMMENT '软座每节车厢座位个数',
  `businessSeatCapacity` int(11) DEFAULT NULL COMMENT '商务座每节车厢座位个数',
  `hardBerthCapacity` int(11) DEFAULT NULL COMMENT '硬卧每节车厢席位数',
  `softBerthCapacity` int(11) DEFAULT NULL COMMENT '软卧每节车厢席位数',
  PRIMARY KEY (`id`)
