-- ----------------------------
-- View structure for orderview
-- ----------------------------
DROP VIEW IF EXISTS `orderview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `orderview` AS select `u`.`username` AS `username`,`mo`.`orderTime` AS `orderTime`,`od`.`passengerId` AS `passengerId`,`od`.`passengerName` AS `passengerName`,`od`.`startStation` AS `startStation`,`od`.`endStation` AS `endStation`,`od`.`trainListId` AS `trainListId`,`od`.`departureTime` AS `departureTime`,`od`.`arriveTime` AS `arriveTime`,`od`.`departureDate` AS `departureDate`,`od`.`trainType` AS `trainType`,`od`.`carriage` AS `carriage`,`od`.`seatNumber` AS `seatNumber`,`od`.`seatDetail` AS `seatDetail`,`od`.`seatType` AS `seatType`,`od`.`price` AS `price`,`od`.`ticketStatus` AS `ticketStatus`,`od`.`orderStatus` AS `orderStatus`,`od`.`isStudent` AS `isStudent`,`mo`.`id` AS `mainOrderId`,`od`.`id` AS `orderDetailId`,`u`.`id` AS `userId` from ((`user` `u` join `orderdetail` `od`) join `mainorder` `mo`) where ((`mo`.`id` = `od`.`mainOrderId`) and (`u`.`id` = `mo`.`userId`)) ;

-- ----------------------------
-- View structure for trainview
-- ----------------------------
DROP VIEW IF EXISTS `trainview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `trainview` AS select `t1`.`trainListId` AS `trainListID`,`t1`.`type` AS `type`,`t1`.`station` AS `startStation`,`t2`.`station` AS `endStation`,`t1`.`departureTime` AS `departureTime`,`t2`.`arriveTime` AS `arriveTime`,(`t2`.`runDay` - `t1`.`runDay`) AS `runDay`,time_format(timediff((str_to_date(`t2`.`arriveTime`,'%H:%i') + interval `t2`.`runDay` day),(str_to_date(`t1`.`departureTime`,'%H:%i') + interval `t1`.`runDay` day)),'%H小时%i分钟') AS `runTime`,(`t2`.`distance` - `t1`.`distance`) AS `distance`,`ts`.`businessSeat` AS `businessSeat`,`ts`.`firstSeat` AS `firstSeat`,`ts`.`secondSeat` AS `secondSeat`,`ts`.`hardSeat` AS `hardSeat`,`ts`.`softSeat` AS `softSeat`,`ts`.`hardBerth` AS `hardBerth1`,`ts`.`hardBerth` AS `hardBerth2`,`ts`.`hardBerth` AS `hardBerth3`,`ts`.`noSeat` AS `noSeat`,`ts`.`softBerth` AS `softBerth1`,`ts`.`softBerth` AS `softBerth2`,(`t2`.`hardSeatPrice` - `t1`.`hardSeatPrice`) AS `hardSeatPrice`,(`t2`.`softSeatPrice` - `t1`.`softSeatPrice`) AS `softSeatPrice`,(`t2`.`businessSeatPrice` - `t1`.`businessSeatPrice`) AS `businessSeatPrice`,(`t2`.`firstSeatPrice` - `t1`.`firstSeatPrice`) AS `firstSeatPrice`,(`t2`.`secondSeatPrice` - `t1`.`secondSeatPrice`) AS `secondSeatPrice`,(`t2`.`hardBerth1Price` - `t1`.`hardBerth1Price`) AS `hardBerth1Price`,(`t2`.`hardBerth2Price` - `t1`.`hardBerth2Price`) AS `hardBerth2Price`,(`t2`.`hardBerth3Price` - `t1`.`hardBerth3Price`) AS `hardBerth3Price`,(`t2`.`softBerth1Price` - `t1`.`softBerth1Price`) AS `softBerth1Price`,(`t2`.`softBerth2Price` - `t1`.`softBerth2Price`) AS `softBerth2Price`,(`t2`.`noSeatPrice` - `t1`.`noSeatPrice`) AS `noSeatPrice` from ((`train` `t1` join `train` `t2`) join `trainlist` `ts`) where ((`t1`.`trainListId` = `t2`.`trainListId`) and (`t1`.`trainListId` = `ts`.`id`) and (`t1`.`station` <> `t2`.`station`) and (`t2`.`stationNumber` > `t1`.`stationNumber`)) ;
